import Header from './Header';
import Footer from './Footer';
import tech from './techi.jpg';
import {BrowserRouter as Router,Route,Link} from "react-router-dom";
import { Redirect } from 'react-router-dom';


class AboutUs extends Component{
    render() {
        return(
            <div>
                <div class="jumbotron jumbotron-fluid">
                <h1>ABOUT US</h1>
                   <img src={tech} className="tech" height="600" width="100%"/>
                       <p className="techi" style={{fontWeight:"bold",color:"black"}} > We are enablers of Digital Transformation across industries, helping partner companies become future ready.
                            Our team of superheroes differentiates itself with a problem-solving attitude and a unique approach to engineering.
                            They deftly untangle complex technical challenges with innovative solutions,
                           keeping a prime focus on the end-user experience.</p>


                </div>
            </div>

        )
    }

}

export default AboutUs;
